import logo from '../logo.svg';
import '../App.css';
import React from 'react';

export default function Navigation(){
    return(
        <div className="nav">
            <nav>
                <ul className="nav-list">
                    <li className="nav-list--logo"><a href='#'><img src={logo} className="App-logo" alt="logo" /></a></li>
                    <li className="nav-list--element"><a href='Banner'>Function A</a></li>
                    <li className="nav-list--element"><a href='aduangseng'>Function B</a></li>
                    <li className="nav-list--element"><a href='Navi'>Function C</a></li>
                    
                </ul>
                <div className="nav-list--prior"><a href='#D'>Booking</a></div>
            </nav>
        </div>
    );
}
